function ____exports.cards(self)
    local lastCardType = getLastCardType(nil)
    local cardType = 1
    do
        local y = 0
        while y <= 6 do
            do
                local x = 0
                while x <= 12 do
                    if asCardType(nil, cardType) == lastCardType then
                        return
                    end
                    local worldPosition = gridCoordinatesToWorldPosition(nil, x, y)
                    spawnCard(
                        nil,
                        asCardType(nil, cardType),
                        worldPosition
                    )
                    cardType = cardType + 1
                    x = x + 1
                end
            end
            y = y + 1
        end
    end
end
